class Solution(object):
    def lengthOfLongestSubstring(self, s):
        if len(s) <= 1:
            return len(s)
        max_len = 0
        p1 = 0
        p2 = 1
        dict = {}
        dict[s[0]] = 0
        while p2 < len(s):
            current_char = s[p2]
            if current_char not in dict:
                dict[current_char] = p2
                p2 += 1
            else:
                length = p2 - p1
                max_len = max(max_len, length)
                loc_p1_goto = dict[current_char] + 1
                while p1 < loc_p1_goto:
                    dict.pop(s[p1])
                    p1 += 1

                dict[current_char] = p2
                p2 += 1
        return max(max_len, (p2 - p1))


